import React from "react";
import "../css_styles/CelebCard.css";
const CelebCart = ({ celeb }) => {
  return (
    <div className="celeb">
      <div className="celeb_header">
        <div className="celeb_header1"></div>
        <div className="celeb_header2">DETAIL</div>
      </div>
      <div className="celeb_container">
        <div className="celeb_items1">
          <img src={celeb.urlToImage} alt="" />
          <div className="detail_text">
            <h2 className="detail_text1">{celeb.title}</h2>
          </div>
        </div>
        <div className="detail_items2">
          <img src={celeb.urlToImage} alt="" />
          <div className="detail_text">
            <h2 className="detail_text1">{celeb.title}</h2>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CelebCart;
